import React from 'react';
import CarService from '../services/CarService';

class CarComponent extends React.Component{    
    constructor(props){
        super(props);
        this.state={
            cars: [
                {"id":1, "name":"Pavan"}
            ]
        }
    }

    componentDidMount(){
        
    }

    render(){
        return(
        <div>
            <h1 >Car List</h1>
            <div>
                {
                    this.state.cars.map(
                        car => {
                            return(
                                <div>
                                <div> {car.id}</div>
                                <div> {car.name}</div>
                                </div>
                            );
                        }
                    )  
                }
            </div>
         </div>

        );
    }
}

export default CarComponent;
